import React from "react";
import { Form, Container, Button } from "react-bootstrap";
import axios from "axios";

const VolunteerForm = () => {
  const [name, setName] = React.useState();

  axios
    .post("/user", {
      firstName: "Fred",
      lastName: "Flintstone",
    })
    .then(function (response) {
      console.log(response);
    })
    .catch(function (error) {
      console.log(error);
    });

  const handleNameChange = (e) => {
    setName(e.target.value);
  };

  return (
    <Container>
      <Form>
        <Form.Group>
          <Form.Label>Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter name"
            onChange={() => handleNameChange()}
          />
        </Form.Group>
        <Form.Group>
          <Form.Label>Language</Form.Label>
          <Form.Control type="text" placeholder="Enter languages spoken" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Occupation</Form.Label>
          <Form.Control type="text" placeholder="Enter occupation" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Skills</Form.Label>
          <Form.Control type="text" placeholder="Enter skills" />
        </Form.Group>

        <Form.Group>
          <Form.Label>Role</Form.Label>
          <Form.Control type="text" placeholder="Enter role" />
        </Form.Group>
        <Button variant="primary" type="submit">
          Submit
        </Button>
      </Form>
    </Container>
  );
};

export default VolunteerForm;
